/*Table structure for table `places` */

DROP TABLE IF EXISTS `places`;

CREATE TABLE `places` (
  `id` int NOT NULL AUTO_INCREMENT,
  `placenm` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `duration` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `season` varchar(100) DEFAULT NULL,
  `reagion` varchar(100) DEFAULT NULL,
  `info` varchar(5000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `img1` mediumblob,
  `img2` mediumblob,
  KEY `id` (`id`)
