/*Table structure for table `srctodes` */

DROP TABLE IF EXISTS `srctodes`;

CREATE TABLE `srctodes` (
  `id` int NOT NULL AUTO_INCREMENT,
  `pname` varchar(100) DEFAULT NULL,
  `snm` varchar(100) DEFAULT NULL,
  `skm` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

/*Data for the table `srctodes` */

insert  into `srctodes`(`id`,`pname`,`snm`,`skm`) values (1,'Shimla','Mumbai','1716.5'),(2,'Agra','Mumbai','1350'),(3,'Agra','Pune','1650'),(4,'Agra','Banglore','2150'),(5,'Shimla','Delhi','889');

/*Table structure for table `subplace` */

DROP TABLE IF EXISTS `subplace`;

CREATE TABLE `subplace` (
  `sid` int NOT NULL AUTO_INCREMENT,
  `placename` varchar(100) DEFAULT NULL,
  `Pointnm` varchar(100) DEFAULT NULL,
  `Discription` varchar(1000) DEFAULT NULL,
  `Nodays` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`sid`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

/*Data for the table `subplace` */

insert  into `subplace`(`sid`,`placename`,`Pointnm`,`Discription`,`Nodays`) values (1,'Agra','Ftehpur Shikri','A card is a flexible and extensible content container. It includes options for headers and footers, a wide variety of content, contextual background colors','1'),(2,'Agra','Fort','A card is a flexible and extensible content container. It includes options for headers and footers, a wide variety of content, contextual background colors','2');

/*Table structure for table `vehicle` */

DROP TABLE IF EXISTS `vehicle`;

CREATE TABLE `vehicle` (
  `id` int NOT NULL AUTO_INCREMENT,
  `cnm` varchar(100) DEFAULT NULL,
  `acnonac` varchar(100) DEFAULT NULL,
  `vtype` varchar(100) DEFAULT NULL,
  `dname` varchar(100) DEFAULT NULL,
  `dcno` varchar(100) DEFAULT NULL,
  `kmrate` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

/*Data for the table `vehicle` */

